    false,nt"url": null,nt"notes": " The STAR facility, within Sandia&amp;#39;s
    Solid Dynamic Physics Department, is one of a few institutions in the world with
    a major shock-physics program. This is the only experimental test facility in the
    world that can cover the full range of pressure (bars to multi-Mbar) for material
    property study utilizing gas/propellant launchers, ramp-loading pulsers, and ballistic
    applications.  ",nt"license_title": "License Not Specified",nt"extras":
